import Scenario from './Scenario'

class ScenarioList extends Component {
     render() {

       return(
         <div className='container '>
         <div className='row'>
         <div className='col'>
         <ul className="list-group ">

            <li>Scenario 1</li>
            <li>Scenario 2</li>
            <li>Scenario 3</li>
            <li>Scenario 4</li>

         {/* { finalScenarioList } */}

         </ul>
         </div>
         </div>
         </div> 
       ) 
   }}

export default ScenarioList;
